function radio_checked(radio){
if(typeof radio=="string") radio=document.getElementsByName(radio);
for(var i=0;i<radio.length;i++) if(radio[i].checked) return radio[i];
}
function filter(str,ref,filterstr){
  var reftemp="";
  var regtemp="";
  for(var i=0;i<ref.length;i++)
  
if(reftemp=str.match(new RegExp(ref[i][0],"gi")))
  for(var j=0;j<reftemp.length;j++)
  if((new RegExp(regtemp=filter_fix(reftemp[j]),"gi")).test(reftemp[j]))
str=str.replace(new RegExp(regtemp,"gi"),filter_get_str([reftemp[j],ref[i][1]],filterstr));
  return str;
};
function filter_fix(str){
str=str.replace(/\+/gi,"\\\+");
str=str.replace(/\-/gi,"\\\-");
str=str.replace(/\*/gi,"\\\*");
str=str.replace(/\//gi,"\\\/");
str=str.replace(/\\/gi,"\\\\");
str=str.replace(/\./gi,"\\\.");
str=str.replace(/\?/gi,"\\\?");
str=str.replace(/\!/gi,"\\\!");
str=str.replace(/\^/gi,"\\\^");
str=str.replace(/\(/gi,"\\\(");
str=str.replace(/\)/gi,"\\\)");
str=str.replace(/\[/gi,"\\\[");
str=str.replace(/\]/gi,"\\\]");
str=str.replace(/\{/gi,"\\\{");
str=str.replace(/\}/gi,"\\\}");
str=str.replace(/\|/gi,"\\\|");
return str;
};
function filter_get_str(str,filterstr){
var temp="";
var en_temp=["","",1];
if(str[1].length<1){
for(var i=0;i<str[0].length;i++){
temp+=str[0].charAt(i);
if((new RegExp("[\u4e00-\u9fa5]","gi")).test(str[0].charAt(i))){
if(i<(str[0].length-1))temp+=filterstr;
if(en_temp[0].length){
en_temp[2]=parseInt(en_temp[0].length/2)+1;//fix the en start bug at 20100605 night.
en_temp[1]=en_temp[0].substring(0,en_temp[2])+filterstr+en_temp[0].substring(en_temp[2],en_temp[0].length);
temp=temp.replace(en_temp[0],en_temp[1]);
en_temp=["","",1];
}
}else{
en_temp[0]+=str[0].charAt(i);
}
}
if(en_temp[0].length){
en_temp[2]=parseInt(en_temp[0].length/2);
en_temp[1]=en_temp[0].substring(0,en_temp[2])+filterstr+en_temp[0].substring(en_temp[2],en_temp[0].length);
temp=temp.replace(en_temp[0],en_temp[1]);
en_temp=["","",1];
}
return temp;
}else{return str[1];}
}

