function minganci(entry,level) {
separator =  $("separator").value;
//if(content == ""){
content = $("co").value; 
//}
if(separator == null || separator == "" ){
separator ="囘"; //默认分隔符
$("separator").value = separator;  
}

entry = content;

var temp= ""+entry;
if(level=="low"){
temp=filter(temp,ref.low,separator);
}else if(level=="medium"){
temp=filter(temp,ref.low,separator);
temp=filter(temp,ref.medium,separator);
}else if(level=="high"){
temp=filter(temp,ref.low,separator);
temp=filter(temp,ref.medium,separator);
temp=filter(temp,ref.high,separator);
}
$("co").value=temp;
}

